import firebase from "firebase/app";

const firebaseConfig = {
    apiKey: precess.env.REACT_APP_API_KEY,
    authDomain: precess.env.REACT_APP_AUTH_DOMAIN,
    projectId: "ntwitter-c5bb7",
    storageBucket: "ntwitter-c5bb7.appspot.com",
    messagingSenderId: "774891290925",
    appId: "1:774891290925:web:8cb06900c07d8d271213a4"
  };

export default firebase.initializeApp(firebaseConfig);
